import React, { Component } from 'react';
import './Logo.css';
import Image from './logo.svg';
import BrandName from './brand-without-claim.svg';
class Logo extends Component {
    render() {
        return (

              <>
                <div className="brandhub_header">
                <a  className="benz_logo" target="_self"  aria-hidden="true">
                <img src= {Image} alt="logo not found"/>
                <img src= {BrandName} className="brand_name" alt="brand name not found"/>
                </a>
                </div>
              </>

        );
    }
}

export default Logo;
